          <a className="link-icon" title="SH++" target="_blank"
              href="https://diploma.programming.org.ua/ru/d/zPE9X6BvVKaZDAm93jw7Q12MYRgNGoqr" rel="noreferrer">
              <i className="fa-solid fa-school fa-2xl"></i>
          </a>
        </footer>
    </div>
);
